import React from 'react'
import { ToDo } from './ToDo'

export const TableToDo = (props) => {
    let { todos } = props
    let arr = todos.map((el, index) => {
        return (
            <ToDo el = {el} index = {index} />
        )
    })
    return(
        <div>
            {arr}
        </div>
    )
}
